class Solution:
    
    def dfs(self, start, K, N, W, prob, d):
        key = str(start) + '-' + str(prob)
        if key in d:
            return d[key]
        sum = 0
        for i in range(1, W+1):
            if start + i >= K:
                if start + i <= N:
                    sum += prob / W
            else:
                sum += self.dfs(start + i, K, N, W, prob/W,d)
                
        d[key] = sum
        return sum
            
    
    
    
    def new21Game(self, N: int, K: int, W: int) -> float:
        if K == 0:
            return 1.0
        
        return self.dfs(0, K, N, W, 1.0, {})
            
        
            
s = Solution()
print(s.new21Game(421,400,47))


